    super(props);
    this.state = {date: new DataCue()};
  }
  render() {
    return  (
      <div>
        <h1>Hello world!</h1>
        <h2>Now {this.state.date.toLocaleTimeString()}.</h2>
      </div>
    );
  }
}

export default App;
